def gaussSeidel(A, b, maxiter=100, eps=0.001):
  n = len(b)
  sol = True
  x = b.copy()
  for i in list(range(1,n+1,1)):
    if (math.fabs(A[i-1][i-1]) > 0.0):
      x[i-1] = b[i-1]/A[i-1][i-1]
